INSERT INTO `dounine_admin_system_bug` (`bugId`, `bugName`, `bugContent`, `bugTypeId`, `userId`, `createTime`, `status`) VALUES
	(2, '页面局部加载数据体验不够好!!', '知识从未如此性感。', 9, 1, '2015-01-11 17:46:17', b'0'),
	(4, '字体颜色与背景色融合，看不清楚', '<p>如图&nbsp;<img src="/ueditor/jsp/upload/image/20150111/1420985390159076969.png" title="1420985390159076969.png" alt="1.png"/></p><p>当前内容属于当前（圈出来的）模块下，然后把鼠标移动到别的菜单标题上时（只是移动，鼠标悬浮其上，没有选中），当前模块的标题没有变色，而是与背景色融合到一起了，看不清了</p>', 9, 1, '2015-01-11 22:18:54', b'0'),
	(5, '自定义角色', '<p>自己定义角色和用户无法指定菜单列表导致 菜单列表无法加载</p>', 9, 1, '2015-01-12 00:54:34', b'0'),
	(6, '排序问题', '<p>所以的列表排序，如果没用业务要求，建议采用日期倒序</p><p><br/></p>', 9, 1, '2015-01-12 00:55:42', b'0'),
	(7, '功能问题', '<p>啊啊</p>', 1, 1, '2015-01-20 20:01:14', b'0'),
	(8, '456', '<p><img src="/ueditor/jsp/upload/image/20150209/1423485163083068243.png" title="1423485163083068243.png" alt="aa.png"/></p>', 9, 1, '2015-02-09 20:32:51', b'1');
